window.bookSummaryJSON = "<p>Billionaire. Playboy. Her brother's best friend. And her baby's daddy? </p> <p>The last time I saw Joanna, she was just a kid, following me around like a puppy dog. But now that she's all grown up, those curves make me want to get behind her. Make her moan my name. </p> <p>Her overprotective brother would never let it happen. But I like a challenge. It can be our little secret. </p> <p>Until her abusive ex-boyfriend shows up in town and ruins everything. If he even tries to lay a finger on her...he'll regret it. </p> <p>I'll do anything to protect my new family. No matter what. </p> <p>Contains mature themes.</p>"; 
